"DT_Output_2" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_2" AS t1
   LEFT OUTER JOIN
   "DT_node_data_2" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_3" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_3", t1."Leaf_11", t1."Leaf_12", t1."Leaf_13", t1."Leaf_15", t1."Leaf_16", t1."Leaf_17", t1."Leaf_22", t1."Leaf_24", t1."Leaf_26", t1."Leaf_27", t1."Leaf_29", t1."Leaf_30", t1."Leaf_31", t1."Leaf_36", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_41", t1."Leaf_43", t1."Leaf_44", t1."Leaf_47", t1."Leaf_48", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_59", t1."Leaf_60", t1."Leaf_64", t1."Leaf_67", t1."Leaf_68", t1."Leaf_69", t1."Leaf_70", t1."Leaf_71", t1."Leaf_76", t1."Leaf_77", t1."Leaf_80", t1."Leaf_81", t1."Leaf_82", t1."Leaf_85", t1."Leaf_86", t1."Leaf_88", t1."Leaf_91", t1."Leaf_92", t1."Leaf_94", t1."Leaf_95", t1."Leaf_96", t1."Leaf_99", t1."Leaf_100", t1."Leaf_103", t1."Leaf_104", t1."Leaf_106", t1."Leaf_109", t1."Leaf_110", t1."Leaf_112", t1."Leaf_113", t1."Leaf_114", t1."Leaf_115", t1."Leaf_119", t1."Leaf_120", t1."Leaf_122", t1."Leaf_123", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" <= 7.500000)) THEN 3 ELSE NULL END AS "Leaf_3",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" <= 4.500000) AND (t."X_98" <= 4.500000) AND (t."X_96" <= 2.500000) AND (t."X_97" <= 1.500000)) THEN 11 ELSE NULL END AS "Leaf_11",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" <= 4.500000) AND (t."X_98" <= 4.500000) AND (t."X_96" <= 2.500000) AND (t."X_97" > 1.500000)) THEN 12 ELSE NULL END AS "Leaf_12",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" <= 4.500000) AND (t."X_98" > 4.500000) AND (t."X_49" <= 4.500000)) THEN 13 ELSE NULL END AS "Leaf_13",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" <= 4.500000) AND (t."X_98" > 4.500000) AND (t."X_49" > 4.500000) AND (t."X_95" <= 2.500000)) THEN 15 ELSE NULL END AS "Leaf_15",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" <= 4.500000) AND (t."X_98" > 4.500000) AND (t."X_49" > 4.500000) AND (t."X_95" > 2.500000)) THEN 16 ELSE NULL END AS "Leaf_16",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" <= 4.500000) AND (t."X_98" <= 4.500000) AND (t."X_96" > 2.500000) AND (t."X_33" <= 1.500000)) THEN 17 ELSE NULL END AS "Leaf_17",
      CASE WHEN((t."X_49" > 3.500000) AND (t."X_11" > 7.500000) AND (t."X_47" > 4.500000) AND (t."X_33" <= 1.500000) AND (t."X_94" > 6.500000)) THEN 22 ELSE NULL END AS "Leaf_22",
