"DT_Output_7" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_7" AS t1
   LEFT OUTER JOIN
   "DT_node_data_7" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_8" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_9", t1."Leaf_10", t1."Leaf_12", t1."Leaf_13", t1."Leaf_14", t1."Leaf_21", t1."Leaf_22", t1."Leaf_23", t1."Leaf_24", t1."Leaf_27", t1."Leaf_29", t1."Leaf_30", t1."Leaf_33", t1."Leaf_34", t1."Leaf_37", t1."Leaf_38", t1."Leaf_39", t1."Leaf_40", t1."Leaf_41", t1."Leaf_43", t1."Leaf_51", t1."Leaf_53", t1."Leaf_54", t1."Leaf_58", t1."Leaf_59", t1."Leaf_60", t1."Leaf_62", t1."Leaf_64", t1."Leaf_65", t1."Leaf_66", t1."Leaf_68", t1."Leaf_69", t1."Leaf_71", t1."Leaf_72", t1."Leaf_78", t1."Leaf_79", t1."Leaf_80", t1."Leaf_83", t1."Leaf_85", t1."Leaf_86", t1."Leaf_89", t1."Leaf_90", t1."Leaf_91", t1."Leaf_92", t1."Leaf_95", t1."Leaf_97", t1."Leaf_98", t1."Leaf_99", t1."Leaf_102", t1."Leaf_103", t1."Leaf_104", t1."Leaf_107", t1."Leaf_108", t1."Leaf_110", t1."Leaf_111", t1."Leaf_113", t1."Leaf_114", t1."Leaf_116", t1."Leaf_118", t1."Leaf_120", t1."Leaf_122", t1."Leaf_123", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_35" <= 1.500000) AND (t."X_98" > 5.500000) AND (t."X_20" > 7.500000) AND (t."X_99" <= 4.000000) AND (t."X_98" <= 8.500000)) THEN 9 ELSE NULL END AS "Leaf_9",
      CASE WHEN((t."X_35" <= 1.500000) AND (t."X_98" > 5.500000) AND (t."X_20" > 7.500000) AND (t."X_99" <= 4.000000) AND (t."X_98" > 8.500000)) THEN 10 ELSE NULL END AS "Leaf_10",
      CASE WHEN((t."X_35" <= 1.500000) AND (t."X_98" > 5.500000) AND (t."X_20" > 7.500000) AND (t."X_99" > 4.000000) AND (t."X_15" > 7.000000)) THEN 12 ELSE NULL END AS "Leaf_12",
      CASE WHEN((t."X_35" <= 1.500000) AND (t."X_98" > 5.500000) AND (t."X_20" > 7.500000) AND (t."X_99" > 4.000000) AND (t."X_15" <= 7.000000) AND (t."X_98" <= 6.500000)) THEN 13 ELSE NULL END AS "Leaf_13",
      CASE WHEN((t."X_35" <= 1.500000) AND (t."X_98" > 5.500000) AND (t."X_20" > 7.500000) AND (t."X_99" > 4.000000) AND (t."X_15" <= 7.000000) AND (t."X_98" > 6.500000)) THEN 14 ELSE NULL END AS "Leaf_14",
