 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_18" AS t1
   LEFT OUTER JOIN
   "DT_node_data_18" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_19" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_1", t1."Leaf_4", t1."Leaf_10", t1."Leaf_13", t1."Leaf_14", t1."Leaf_17", t1."Leaf_18", t1."Leaf_21", t1."Leaf_23", t1."Leaf_24", t1."Leaf_29", t1."Leaf_30", t1."Leaf_32", t1."Leaf_34", t1."Leaf_35", t1."Leaf_36", t1."Leaf_41", t1."Leaf_42", t1."Leaf_43", t1."Leaf_45", t1."Leaf_46", t1."Leaf_49", t1."Leaf_51", t1."Leaf_52", t1."Leaf_55", t1."Leaf_57", t1."Leaf_58", t1."Leaf_59", t1."Leaf_61", t1."Leaf_62", t1."Leaf_63", t1."Leaf_65", t1."Leaf_66", t1."Leaf_69", t1."Leaf_71", t1."Leaf_73", t1."Leaf_74", t1."Leaf_78", t1."Leaf_81", t1."Leaf_83", t1."Leaf_84", t1."Leaf_87", t1."Leaf_88", t1."Leaf_89", t1."Leaf_90", t1."Leaf_96", t1."Leaf_98", t1."Leaf_100", t1."Leaf_101", t1."Leaf_102", t1."Leaf_105", t1."Leaf_109", t1."Leaf_110", t1."Leaf_111", t1."Leaf_112", t1."Leaf_113", t1."Leaf_114", t1."Leaf_116", t1."Leaf_119", t1."Leaf_120", t1."Leaf_123", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_75" <= 4.500000)) THEN 1 ELSE NULL END AS "Leaf_1",
      CASE WHEN((t."X_75" > 4.500000) AND (t."X_87" > 4.500000)) THEN 4 ELSE NULL END AS "Leaf_4",
      CASE WHEN((t."X_75" > 4.500000) AND (t."X_87" <= 4.500000) AND (t."X_99" > 5.500000) AND (t."X_72" <= 2.500000) AND (t."X_95" > 8.500000)) THEN 10 ELSE NULL END AS "Leaf_10",
      CASE WHEN((t."X_75" > 4.500000) AND (t."X_87" <= 4.500000) AND (t."X_99" > 5.500000) AND (t."X_72" <= 2.500000) AND (t."X_95" <= 8.500000) AND (t."X_93" > 7.500000) AND (t."X_97" <= 3.500000)) THEN 13 ELSE NULL END AS "Leaf_13",
