      CASE WHEN((t."X_75" > 4.500000) AND (t."X_87" <= 4.500000) AND (t."X_99" > 5.500000) AND (t."X_72" <= 2.500000) AND (t."X_95" <= 8.500000) AND (t."X_93" <= 7.500000) AND (t."X_20" <= 2.500000) AND (t."X_34" > 0.500000)) THEN 18 ELSE NULL END AS "Leaf_18",
      CASE WHEN((t."X_75" > 4.500000) AND (t."X_87" <= 4.500000) AND (t."X_99" > 5.500000) AND (t."X_72" > 2.500000) AND (t."X_98" <= 1.500000) AND (t."X_93" <= 5.000000)) THEN 21 ELSE NULL END AS "Leaf_21",
