"DT_Output_24" AS 
 (SELECT
   t1."index" AS "index",
   t1.node_id AS node_id,
   t2.nid AS nid,
   t2."P_0" AS "P_0", t2."P_1" AS "P_1", t2."P_2" AS "P_2", t2."P_3" AS "P_3", 
   t2."D" AS "D", 
   t2."DP" AS "DP"
  FROM
   "DT_node_lookup_24" AS t1
   LEFT OUTER JOIN
   "DT_node_data_24" AS t2
   ON t1.node_id = t2.nid
 ),
"DT_node_lookup_25" AS 
 (SELECT
    t."index" AS "index",
    COALESCE( t1."Leaf_2", t1."Leaf_9", t1."Leaf_10", t1."Leaf_11", t1."Leaf_12", t1."Leaf_13", t1."Leaf_15", t1."Leaf_16", t1."Leaf_25", t1."Leaf_26", t1."Leaf_27", t1."Leaf_31", t1."Leaf_32", t1."Leaf_33", t1."Leaf_34", t1."Leaf_36", t1."Leaf_40", t1."Leaf_41", t1."Leaf_43", t1."Leaf_44", t1."Leaf_46", t1."Leaf_47", t1."Leaf_48", t1."Leaf_49", t1."Leaf_53", t1."Leaf_54", t1."Leaf_56", t1."Leaf_57", t1."Leaf_58", t1."Leaf_62", t1."Leaf_67", t1."Leaf_69", t1."Leaf_70", t1."Leaf_71", t1."Leaf_72", t1."Leaf_75", t1."Leaf_79", t1."Leaf_80", t1."Leaf_83", t1."Leaf_84", t1."Leaf_86", t1."Leaf_87", t1."Leaf_89", t1."Leaf_90", t1."Leaf_94", t1."Leaf_96", t1."Leaf_97", t1."Leaf_99", t1."Leaf_100", t1."Leaf_103", t1."Leaf_107", t1."Leaf_108", t1."Leaf_109", t1."Leaf_110", t1."Leaf_112", t1."Leaf_113", t1."Leaf_114", t1."Leaf_117", t1."Leaf_119", t1."Leaf_120", t1."Leaf_122", t1."Leaf_124", t1."Leaf_125", t1."Leaf_126" ) AS node_id
  FROM
    "model_input" AS t
    LEFT OUTER JOIN
   (SELECT
      t."index" AS "index",
      CASE WHEN((t."X_46" > 2.500000)) THEN 2 ELSE NULL END AS "Leaf_2",
      CASE WHEN((t."X_46" <= 2.500000) AND (t."X_98" > 8.500000) AND (t."X_92" <= 4.500000) AND (t."X_10" <= 6.000000) AND (t."X_64" <= 4.500000)) THEN 9 ELSE NULL END AS "Leaf_9",
